<br>Of course, limiting the fun to a four-way might get a little stale although the group still messes around with the Judo Club and the Newspaper Club, more girls have come to get in on the excitement. Takatoshi', CHAR(39), 's sister Kotomi, a new student at Ousai, is as perverse as the president, while Uomi, the aloof student council president of the nearby Eiryou High School, fits right in with the insanity at Ousai. With loads of absurdity and sexual humor that keeps on coming, Takatoshi needs to harden up if he is going to keep up with all the madness around him.<br>
